mily’s kitchen Saturday, Raquelle Boyd professionally known as Chef Kisses moved with confidence well beyond her years as she prepared the feast she began working on since 6 that morning.\n\nAfter the success of her first pop-up drive-thru, which drew in a few dozen customers—some even waited 2 hours to try her food, the 11-year-old was ready for round two.\n\n“It made me feel happy and that people really enjoy my food,” she said.\n\nOn Saturday she spent hours whipping up quite the menu, with very little help, cooking fried chicken, collard greens, mac n cheese, cornbread and more.\n\nWhen Raquelle first came to her parents with the idea, mom Sarhena Boyd said her first instinct was to encourage her passion like they had done pretty much all her life, from her play kitchen set to her first deep fryer at 5 years old.\n\nMore details here: https://www.tmj4.com/news/local-news/people-really-enjoy-my-food-11-year-old-chef-draws-in-dozens-of-customers\n\n---- \n\nTMJ4 News in Milwaukee, Wisconsin is your source for local breaking news, in-depth investigations, the latest weather and traffic, and livestreams on news happening right now.\n \nSubscribe to the TMJ4 YouTube channel: https://www.youtube.com/@tmj4\n\nWatch 24/7 TMJ4 live coverage here: https://www.tmj4.com/live\n \nDownload the TMJ4 app: https://www.tmj4.com/apps\n\nSign up for the TMJ4 Newsletter: https://www.tmj4.com/newsletters\n \nWatch more TMJ4 on YouTube: https://www.youtube.com/@tmj4\nOn The Go with James Groh: https://on.tmj4.com/3V1oLvH\nMilwaukee Tonight: https://on.tmj4.com/3UZroya","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/ghQJ0d0us8Y/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLBmRQT_dqiSHfKhRbgfTIbKybbHSw","width":168,"height":94},{"url":"https://i.ytimg.com/vi/ghQJ0d0us8Y/hqdefault.jpg?sqp=-oaymwEbCMQBEG5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLCPWL1aYdbQejuurkWbyrKSthpiNg","width":196,"height":110},{"url":"https://i.ytimg.co
